import React from 'react'
import styled from 'styled-components'

export default function Card(props: any) {
    console.log("ðŸš€ ~ file: index.tsx ~ line 6 ~ Card ~ props", props)
    const { name, price, description, image, count } = props
    return (
        <Container>
            <CardHeader>
                <h2>{name}</h2>
                <StyledImage>
                    <img src={image} alt="" />
                </StyledImage>
                <p>{description}</p>
                <p>{price}</p>
                <p>{count} pieces</p>
            </CardHeader>
        </Container>
    )
}

const Container = styled.div`
    background-color: aliceblue;
    border-radius: 23px;
    padding: 20px;
    margin: 0 40px 40px;
    height: 480px;
    width: 280px;
`

const CardHeader = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
`

const StyledImage = styled.div`
    width: 100%;
    height: 250px;
    img {
        width: 100%;
        height: 100%;
    }
`

const ButtonContainer = styled.div`
    display: flex;
    width: 100%;
    justify-content: space-between;
`

const Button = styled.button`
    padding: 20px;
    border-radius: 10px;
`
